--
-- Name: joined_cards; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW public.joined_cards AS
 SELECT cards.id,
    cards.name,
    cards.realname,
    cards.cardtype,
    cards.property,
    cards.types,
    cards.attribute,
    cards.materials,
    cards.lore,
    cards.archetypes,
    cards.supports,
    cards.antisupports,
    cards.link,
    cards.linkarrows,
    cards.atk,
    cards.def,
    cards.level,
    cards.pendulumscale,
    cards.rank,
    cards.tcgexists,
    cards.ocgexists,
    cards.img,
    cards.url,
    cards.passcode,
    cards.ocgstatus,
    cards.tcgadvstatus,
    cards.tcgtrnstatus,
    cards.cardtrivia,
    ar.name AS archetypename,
    s.name AS supportname,
    asu.name AS antisupportname,
    tr.id AS translationid,
    tr.cardid,
    tr.language,
    tr.name AS translationname,
    tr.lore AS translationlore
   FROM (((((((public.cards
     LEFT JOIN public.card_to_archetypes ca ON ((ca.cardarchetypesid = cards.archetypes)))
     LEFT JOIN public.archetypes ar ON ((ar.id = ca.archetypesid)))
     LEFT JOIN public.card_to_supports cs ON ((cs.cardsupportsid = cards.supports)))
     LEFT JOIN public.supports s ON ((s.id = cs.supportsid)))
     LEFT JOIN public.card_to_antisupports cas ON ((cas.cardantisupportsid = cards.antisupports)))
     LEFT JOIN public.antisupports asu ON ((asu.id = cas.antisupportsid)))
     LEFT JOIN public.translations tr ON ((tr.cardid = cards.id)));


