--
-- Name: upsert_boosterpack_date(integer, character varying, character varying); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.upsert_boosterpack_date(boosterpackdatesid integer, name character varying, date character varying) RETURNS integer
    LANGUAGE plpgsql
    AS $$
	declare
		result integer;
	BEGIN
		
		on conflict on constraint boosterpack_dates_boosterpackid_name_unique_pair
		do
			update set
				name = excluded.name,
				date = excluded.date
		returning id into result;
	
		return result;
		
	END;
$$;


--
-- Name: upsert_translation(integer, character varying, character varying, character varying); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.upsert_translation(cardid integer, language character varying, name character varying, lore character varying) RETURNS integer
    LANGUAGE plpgsql
    AS $$
declare 
	result integer;
BEGIN
	
    values (cardid, language, name, lore)
    on conflict on constraint cardid_language_pair_unique
        do update
        set name = excluded.name,
            lore = excluded.lore
    where translations.cardid = excluded.cardid
      and translations.language = excluded.language
      and (translations.name != excluded.name or translations.lore != excluded.lore)
    returning id into result;

	return result;
		
END;
$$;


