--
-- Name: joined_boosterpacks; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW public.joined_boosterpacks AS
 SELECT b.id,
    b.name,
    b.dates,
    b.cards,
    b.url,
    b.tcgexists,
    b.ocgexists,
    bd.name AS boosterpackdatename,
    bd.date AS boosterpackdate,
    bc.name AS boosterpackcardname,
    br.name AS boosterpackrarity
   FROM (((public.boosterpacks b
     JOIN public.boosterpack_cards bc ON ((bc.boosterpackcardsid = b.cards)))
     JOIN public.boosterpack_rarities br ON ((br.boosterpackraritiesid = bc.rarities)))
     JOIN public.boosterpack_dates bd ON ((bd.boosterpackdatesid = b.dates)));


